import s from "./style.module.css";
const LoginLayout = (bg) => {
  return (
    <div className={s.container}>
      <div className={s.loginWrapper}></div>
      <div className={s.loginBg}>
        <img src={bg} alt="" />
      </div>
    </div>
  );
};

export default LoginLayout;
